import { useEffect, useState } from 'react';
import './App.css';

function App() {
  const [posts, setPosts] = useState([]);
  console.log('Pai renderizou!');

  //component did mount

  useEffect(() => {
    fetch('https://jsonplaceholder.typicode.com/posts')
      .then((r) => r.json())
      .then((r) => setPosts(r));
  });

  return (
    <div className="App">
      <p>Teste 1</p>
      <h1>Oi</h1>
    </div>
  );
}

export default App;
